import React, {useState} from 'react';
import './style.scss'
import img from '../../img/photo_2020-11-23_16-01-43.jpg'
import About from "../About";
import { RiFacebookBoxFill } from "react-icons/ri";
import Education from "../Education";
import Project from "../Project";

const Main = () => {
    const [value, setValue] = useState('About')
    return (
        <div className='main'>
            <div className='left-container'>
                <img width={260} src={img} alt='На этом фото Александр Жук'/>
                <div className='btn-container'>
                    <div className='btn' onClick={() => setValue('About')}>About</div>
                    <div className='btn' onClick={() => setValue('Skills')}>Skills</div>
                    <div className='btn' onClick={() => setValue('Projects')}>Projects</div>
                    <div className='icons'>
                        <RiFacebookBoxFill/>
                    </div>
                </div>
            </div>
            {value === 'About' && <About/>}
            {value === 'Skills' && <Education/>}
            {value === 'Projects' && <Project/>}
        </div>
    );
};

export default Main;
